How to list unique values ​in a MongoDB collection if the values ​are arrays of objects?<p>I need to output a list of unique values in a collection. I've used the <code>distinct</code> method when the values are either a string or a number. But in this situation, the values are an array of objects.</p>
<p>The simplified model looks like this:</p>
<pre><code>const mongoose = require('mongoose');

const ItemModel = mongoose.Schema({  
  category: [{
    lang: String,
    text: String
  }],
  discount: {
    type: String,
    required: true
  },
  date: {
    type: Date,
    default: Date.now
  }
});

module.exports = mongoose.model('Items', ItemModel);
</code></pre>
<p>A typical <code>find()</code> query without parameters produces this result:</p>
<pre><code>[
  {
    &quot;_id&quot;: &quot;5fd8712b374a9a1410f786bf&quot;,
    &quot;category&quot;: [
      {
        &quot;_id&quot;: &quot;5fd8712b374a9a1410f786c2&quot;,
        &quot;lang&quot;: &quot;RU&quot;,
        &quot;text&quot;: &quot;Домашняя одежда&quot;
      },
      {
        &quot;_id&quot;: &quot;5fd8712b374a9a1410f786c3&quot;,
        &quot;lang&quot;: &quot;EN&quot;,
        &quot;text&quot;: &quot;Homewear&quot;
      }
    ],
    &quot;discount&quot;: &quot;45%&quot;,
    &quot;date&quot;: &quot;2020-12-12T11:12:37.811Z&quot;,
    &quot;__v&quot;: 0
  },
  {
    &quot;_id&quot;: &quot;5fd4a5b95e1a251ac96b2e08&quot;,
    &quot;category&quot;: [
      {
        &quot;_id&quot;: &quot;5fd4a5b95e1a251ac96b2e0b&quot;,
        &quot;lang&quot;: &quot;RU&quot;,
        &quot;text&quot;: &quot;Домашняя одежда&quot;
      },
      {
        &quot;_id&quot;: &quot;5fd4a5b95e1a251ac96b2e0c&quot;,
        &quot;lang&quot;: &quot;EN&quot;,
        &quot;text&quot;: &quot;Homewear&quot;
      }
    ],
    &quot;discount&quot;: &quot;35%&quot;,
    &quot;date&quot;: &quot;2020-12-12T11:12:37.811Z&quot;,
    &quot;__v&quot;: 0
  },
  {
    &quot;_id&quot;: &quot;5fd49e415e1a251ac96b2dfc&quot;,
    &quot;category&quot;: [
      {
        &quot;_id&quot;: &quot;5fd49e415e1a251ac96b2dff&quot;,
        &quot;lang&quot;: &quot;RU&quot;,
        &quot;text&quot;: &quot;Активный отдых&quot;
      },
      {
        &quot;_id&quot;: &quot;5fd49e415e1a251ac96b2e00&quot;,
        &quot;lang&quot;: &quot;EN&quot;,
        &quot;text&quot;: &quot;Active&quot;
      }
    ],
    &quot;discount&quot;: &quot;50%&quot;,
    &quot;date&quot;: &quot;2020-12-12T10:06:53.120Z&quot;,
    &quot;__v&quot;: 0
  }
]
</code></pre>
<p>I need to output a list of unique <code>&quot;category.text&quot;</code> values where <code>&quot;lang&quot;</code> equals <code>&quot;EN&quot;</code>. At the output, we should get an array like this:</p>
<pre><code>[ &quot;Active&quot;, &quot;Homewear&quot; ]
</code></pre>
<p>How to do it the right way, with good performance?
Regards.</p>

