How to filter in mongoose aggregation while joining based on two equal fields stored in array of objects?<p>Lets say I have two documents in products collection:</p>
<pre><code>{
  _id: ObjectId(&quot;abc&quot;), name: &quot;Pizza&quot;,
  attributes: [
    {salePrice: 250, size: &quot;Small&quot;},
    {salePrice: 300, size: &quot;Medium&quot;},
    {salePrice: 350, size: &quot;Large&quot;}
  ]
},
{
  _id: ObjectId(&quot;xyz&quot;), name: &quot;Burger&quot;,
  attributes: [
    {salePrice: 100, size: &quot;Regular&quot;},
    {salePrice: 150, size: &quot;Large&quot;}
  ]
}
</code></pre>
<p>I have added products to cart so a document in cart collection looks like this:</p>
<pre><code>{
  cartProducts: [
    { productId: ObjectId(&quot;xyz&quot;), type: &quot;Large&quot;, quantity: 5 },
    { productId: ObjectId(&quot;abc&quot;), type: &quot;Regular&quot;, quantity: 2 }, 
  ]
}
</code></pre>
<p>I want to retrieve cart details ( all cart items ) with details based on &quot;type&quot; field of cart.cartProducts meet the &quot;size&quot; field of product.attributes. So the output would look like this:</p>
<pre><code> cart items
{
  cartDetails: [
    {
      name: &quot;Pizza&quot;, quantity: 5, salePrice: 350, productId: &quot;xyz&quot;
    },
    {
      name: &quot;Burger&quot;, quantity: 2, salePrice: 100, productId: &quot;abc&quot;
    }
  ]
}
</code></pre>
<p>How can I do that using aggregate. What are the next stages?</p>
<pre><code>Cart.aggregate([
  { $unwind: { path: &quot;$cartProducts&quot; } },
  {$lookup:{ from:&quot;products&quot;, localField:&quot;cartProducts.productId&quot;, foreignField:&quot;_id&quot;, as:&quot;products&quot; } },
  { $unwind: { path: &quot;$products&quot;, includeArrayIndex: &quot;arrayIndex&quot;, preserveNullAndEmptyArrays: true } }
]);
</code></pre>

